import React, {Component} from 'react';

class Message extends Component {
    constructor() {
        super()
        this.state = {
            message: 'Welcome visitor'
        }
    }
    render() {
        return (
            <div>
                {this.state.message}
                <button>Subscribe</button>
            </div>
        );
    }
}

export default Message;
